// Sidebar.js
import React from 'react';

const Sidebar = () => {
  return (
    <div className="sidebar">
      {/* Sidebar content here */}
      <h2>Sidebar</h2>
      <ul>
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </div>
  );
};

export default Sidebar;
